BEGIN;

-- 1. Clean up any previous sim data
DELETE FROM auth.users WHERE email LIKE 'bot%@runstrict.test';

-- 2. Insert auth.users

-- 3. Insert public.users

-- 4. Update hexes for team variety
UPDATE public.hexes SET last_runner_team = 'blue', last_flipped_at = NOW() - INTERVAL '2 hours' WHERE id IN ('89283472ab3ffff', '89283472abbffff', '89283472ac3ffff', '89283472ac7ffff', '89283472acbffff', '89283472acfffff', '89283472ad3ffff', '89283472ad7ffff', '89283472adbffff', '89283472e03ffff', '89283472e07ffff', '89283472e0bffff', '89283472e0fffff', '89283472e23ffff', '89283472e27ffff');
UPDATE public.hexes SET last_runner_team = 'purple', last_flipped_at = NOW() - INTERVAL '1 hour' WHERE id IN ('89283472e2bffff', '89283472e2fffff', '89283472e33ffff', '89283472e37ffff', '89283472e3bffff', '89283472e47ffff', '89283472e4fffff', '89283472e63ffff', '89283472e67ffff', '89283472e6bffff', '89283472e6fffff', '89283472e73ffff', '89283472e77ffff', '89283472e7bffff');

-- 5. Rebuild hex_snapshot for today
DELETE FROM public.hex_snapshot WHERE snapshot_date = '2026-02-17';
SELECT id, last_runner_team, '2026-02-17', parent_hex, last_flipped_at FROM public.hexes;

-- 6. Insert run_history

-- 7. Update daily_buff_stats
DELETE FROM public.daily_buff_stats WHERE stat_date BETWEEN '2026-02-12' AND '2026-02-16';

-- 8. Update daily_all_range_stats
DELETE FROM public.daily_all_range_stats WHERE stat_date BETWEEN '2026-02-12' AND '2026-02-16';

-- 9. Update user aggregates from run_history
UPDATE public.users u SET
  total_distance_km = agg.total_dist,
  avg_pace_min_per_km = agg.avg_pace,
  avg_cv = agg.avg_cv,
  total_runs = agg.run_count,
  cv_run_count = agg.cv_count
FROM (
  SELECT user_id,
    SUM(distance_km) as total_dist,
    CASE WHEN SUM(distance_km) > 0 THEN SUM(duration_seconds / 60.0) / SUM(distance_km) ELSE NULL END as avg_pace,
    AVG(cv) FILTER (WHERE cv IS NOT NULL) as avg_cv,
    COUNT(*) as run_count,
    COUNT(cv) as cv_count
  FROM public.run_history
  WHERE user_id IN (SELECT id FROM auth.users WHERE email LIKE 'bot%@runstrict.test')
  GROUP BY user_id
) agg
WHERE u.id = agg.user_id;

COMMIT;